import React, {Component} from 'react';

class Contact extends Component {
    render() {
        return (
            <div className={"container pt-5"}>
                <div className="row">
                    <div className="col">
                        <button className="btn btn-light">Phone</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Contact;
